// @ts-nocheck
import React, { ReactNode, HTMLAttributes } from 'react';
import { createComponent } from '../lib';
import type { JSX } from '@vime/core/dist/types';

import { 
  VmCaptions 
} from '@vime/core';

import { define } from '../lib';


define('vm-captions', VmCaptions);


export interface CaptionsProps extends JSX.VmCaptions, HTMLAttributes<HTMLVmCaptionsElement> {
  children?: ReactNode | ReactNode[]
};

export default createComponent<HTMLVmCaptionsElement, CaptionsProps>(
  'vm-captions',
  new Set(['hidden','isControlsActive','isVideoView','playbackStarted','textTracks','currentTextTrack','isTextTrackVisible']),
);
